import React from 'react'
import CategoryContainer from "../categories/category-container";
import TasksContainer from "../tasks/tasks-container";
import './app.css'

const App = () => {
    return (
        <div className='app container'>
            <div className='row'>
                <div className='col'>
                    <CategoryContainer />
                </div>
                <div className='col'>
                    <TasksContainer />
                </div>
            </div>
        </div>
    )
}

export default App
